/*+------------------------------------------------------------+
 |       -TACHADO        
 +------------------------------------------------------------+*/
.is-through {
  position: relative;
  width: max-content;
}
.is-through::after {
  content: "";
  background-color: #000;
  width: 100%;
  position: absolute;
  bottom: 50%;
  left: 0;
  height: 1px;
}

.text-lowercase {
  text-transform: lowercase;
}

.text-uppercase {
  text-transform: uppercase;
}

.text-capitalize {
  text-transform: capitalize;
}

.text-transform-none {
  text-transform: none;
}

.text-underline {
  text-decoration: underline;
}

.has-ellipsis {
  text-overflow: ellipsis;
  overflow: hidden;
  white-space: nowrap;
  vertical-align: top;
  width: 100%;
  margin: 0 0 7px;
}

/** DENTRO DE UN CONTENT DE UN RATIO CENTRAMOS EL VIDEO**/
.video-cover {
  position: absolute;
  top: 50%;
  left: 50%;
  width: 100%;
  height: 100%;
  object-fit: cover;
  -webkit-transform: translate(-50%, -50%);
  transform: translate(-50%, -50%);
}

hr {
  width: 100%;
