.arrow-cover {
  height: auto;
  padding: 30px;
  position: absolute;
  bottom: 0;
  right: 0;
  color: #000;
  display: -webkit-box;
  display: -ms-flexbox;
  display: flex;
  opacity: 1;
  -webkit-box-align: end;
  -ms-flex-align: end;
  align-items: flex-end;
  transition: opacity 0.3s ease;
  z-index: 6;
}

.arrow-cover svg {
  -webkit-animation: bounce 0.8s infinite alternate;
  animation: bounce 0.8s infinite alternate;
}

@-webkit-keyframes bounce {
  0% {
    -webkit-transform: translateZ(0);
    transform: translateZ(0);
  }
  to {
    -webkit-transform: translate3d(0, -15px, 0);
    transform: translate3d(0, -15px, 0);
  }
}
@keyframes bounce {
  0% {
    -webkit-transform: translateZ(0);
    transform: translateZ(0);
  }
  to {
    -webkit-transform: translate3d(0, -15px, 0);
    transform: translate3d(0, -15px, 0);
  }
}
.line-scrolldown {
  position: absolute;
  top: calc(100% - 120px);
  left: 50%;
  z-index: 3;
  opacity: 1;
  -webkit-transform: translateX(-50%);
  transform: translateX(-50%);
}
.line-scrolldown:before {
  content: "";
  position: absolute;
  top: 40px;
  left: 50%;
  width: 12px;
  height: 12px;
  border-radius: 50%;
  background: black;
  -webkit-transform: translateX(-50%);
  transform: translateX(-50%);
}
.line-scrolldown::after {
  content: "";
  position: absolute;
  top: 40px;
  left: 50%;
  width: 1px;
  height: 0;
  border-radius: 2px;
  background: black;
  -webkit-transform: translateX(-50%);
  transform: translateX(-50%);
  -webkit-animation: stretch 1s 1.5s cubic-bezier(0.55, 0.085, 0, 0.99) forwards;
  animation: stretch 1s 1.5s cubic-bezier(0.55, 0.085, 0, 0.99) forwards;
}

.has-light .arrow-cover {
  color: #fff;
}
.has-light .line-scrolldown:before {
  background: white;
}
.has-light .line-scrolldown::after {
  background: #fff;
}

