/*+------------------------------------------------------------+
 |       -GRUPOS DE BOTONES    
 +------------------------------------------------------------+*/
/**
 * Con esta clase podemos agrupar los botones
 * en grupos horizontales.
 *
 */
.btns {
  align-items: center;
  display: flex;
  flex-wrap: wrap;
  justify-content: flex-start;
}
.btns .btn {
  margin-right: 8px;
}

