  margin-right: 8px;
}

.btn-group {
  position: relative;
  display: flex;
}
.btn-group > :not(:first-child):not(:last-child) {
  border-radius: 0;
  margin-left: -1px;
}
.btn-group [class^=btn--],
.btn-group [class*=" btn--"] {
  position: relative;
  border-radius: 0;
  float: left;
  margin-right: 0;
}
.btn-group [class^=btn--]:first-child,
.btn-group [class*=" btn--"]:first-child {
  margin-left: 0;
}
.btn-group [class^=btn--]:last-child,
.btn-group [class*=" btn--"]:last-child {
  margin-left: -1px;
  outline: none;
}
.btn-group .btn {
  border-radius: 0;
}
.btn-group .btn:first-child() {
  border-radius: 8px 0 0 8px;
}
.btn-group .btn:last-child() {
  border-radius: 0 8px 8px 0;
}

