/*+------------------------------------------------------------+
 |-COLORS
 +------------------------------------------------------------+*/


$colorsGuide: (
  black: #000000,
  secondary-color: #f5f5f5,
  gray-90: #171717,
  gray-80: #2e2e2e,
  gray-70: #464646,
  gray-60: #5d5d5d,
  gray-50: #757575,
  gray-40: #909090,
  gray-30: #acacac,
  gray-20: #c7c7c7,
  gray-10: #e3e3e3,
  makumba: #999999,
  white-smoke: #f5f5f5,
  White: #ffffff,
  link: #c7c7c7,
  linkHover: #999,


  primary: #000,
  color-1: #e6f5ff,
  color-2: #b5e6c8,
  color-3: #fef7c1,
  color-4: #fadfc1,
  color-5: #fcd8cd,

   error: #fd675e,
   sales: #fa3b2c,
   Sales-Variant: #e43628,
   error-primary:#D0021B ,


   primary-guide:#121F2A,
   secondary-guide:#6759bb,
   ternary-guide:#6759bb,
  )!default;

  @function color($color) {
   @return map-get($colorsGuide, $color);
 }





 $black : nth($colorsGuide, 1) !default;
 $white : nth($colorsGuide, 2) !default;

 $gray-90: nth($colorsGuide, 3) !default;
 $gray-80: nth($colorsGuide, 4) !default;
 $gray-70: nth($colorsGuide, 5) !default;
 $gray-60: nth($colorsGuide, 6) !default;
