 $gray-40: nth($colorsGuide, 8) !default;
 $gray-30: nth($colorsGuide, 9) !default;
 $gray-20: nth($colorsGuide, 10) !default;
 $gray-10:   nth($colorsGuide, 11) !default;
 $white-smoke:nth($colorsGuide, 12) !default;

 $color-1:   nth($colorsGuide, 13) !default;
 $color-2 :  nth($colorsGuide, 14) !default;
 $color-3  : nth($colorsGuide, 15) !default;
 $color-4  : nth($colorsGuide, 16) !default;
