 $color-9 :  nth($colorsGuide, 21) !default;
 $color-10 : nth($colorsGuide, 22) !default;
 $color-11 : nth($colorsGuide, 23) !default;

 $primary:#000 !default;
 $error: #fd675e!default;

$primary-guide:#121F2A !default;
$secondary-guide:#6759bb !default;
$ternary-guide:#6759bb !default;



/*+------------------------------------------------------------+
 |       -IMPORT FONTS
 +------------------------------------------------------------+*/


$font-family-secondary:"Times new roman"!default;
$font-weight-secondary-light:300!default;
$font-weight-secondary-medium:400!default;
$font-weight-secondary-bold:700!default;


/* BREAKPOINTS */


 /*+------------------------------------------------------------+
  |       -FASE 2 : PERSONALIZA TU HOLYGRAIL
  +------------------------------------------------------------+*/


/*  breakpoints  */

/*  grid  */

 $totalCols :      12!default;
 $padding-global: 8px!default;
 $padding-mobile: 24px!default;
 $padding-desktop: 40px!default;
 $padding-button: 8px!default;
 $padding-btn:   16px!default;
 $height-inputs: 48px!default;


$container: 800px !default;/* maxwidth del container */
$container-2: 700px!default;/* maxwidth del container2*/
$container-3: 900px!default;/* maxwidth del container3*/
$container-4: 356px!default;/* maxwidth del container4*/
$container-5: 400px!default;/* maxwidth del container5*/
$container-6: 442px!default;/* maxwidth del container6*/
$container-7: 595px!default;/* maxwidth del container7*/
$container-8: 395px!default;/* maxwidth del container8*/
$container-9: 798px!default;/* maxwidth del container8*/


$transition:278ms;




/*  alturas minimas  */

$height-xs:80px !default;
$height-sm:100px !default;
$height-md:350px !default;
$height-lg:400px !default;
$height-xl:450px !default;
$height-full:100vh !default;
$height-home:calc(100vh - 80px) !default;

/*  animaciones  */

$transition:278ms!default;



/* ALTURA MINIMA */

$min-width:319px!default;

$min-vw:319px!default;
$max-vw:1500px!default;


/* Types.scss */

/* Types responsive  xs sm md lg xl line-height font-weight */

   $fs: "font-size";
   $lh: "line-height";
   $headers:/* name:mobile,768,992,1280,line-height,font */
          (h1: (32px, 32px, 32px,  40px, 1.2, "medium" ),
           h2: (24px, 24px, 24px,  32px, 1.2, "medium" ),
           h3: (18px, 18px, 18px,  24px, 1.2, "medium" ),
           h4: (16px, 16px, 16px,  18px, 1.2, "medium" ),
           h5: (14px, 14px, 14px,  16px, 1.2, "medium" ),
           h6: (12px, 12px, 12px,  14px, 1.2, "medium" ),
           h7: (10px, 10px, 10px,  12px, 1.2, "medium" ),
           h8: (8px,   8px,  8px,  10px, 1.2, "medium" ),
     display1: (32px, 32px, 32px,  48px, 1.2, "bold"   ),/* PROMOTIONS BANNER */
     display2: (20px, 20px, 20px,  40px, 1.2, "bold"   ),/* SALES */
     display3: (16px, 16px, 16px,  24px, 1.5, "medium" ),/* BLACK FRIDAY */
     display4: (14px, 14px, 14px,  24px, 1.5, "medium" ),/* SALES */
     display5: (14px, 14px, 14px,  18px, 1.5, "regular"),/* BLACK FRIDAY */
     display6: (12px, 12px, 12px,  18px, 1.5, "regular"),/* SALES */
     display7: (14px, 14px, 14px,  18px, 1.5, "medium" ),/* SALES + BLACK FRIDAY */
           p1: (12px, 12px, 12px,  14px, 1.4, "regular"),
           p2: (14px, 14px, 16px,  18px, 1.4, "regular"),
           p4: (14px, 14px, 16px,  18px, 1.4, "medium" )) !default;

        //  primary   font (regular, medium , bold) 
        //  secondary font (2-regular, 2-medium , 2-bold) 


/* TYPES FIJOS */

$headersFixers: (/*name :  fontsize, lineheight */
   12 : (12px, 1.5),
   14 : (14px, 1.5),
   16 : (16px, 1.5),
   18 : (18px, 1.5),
   20 : (20px, 1.5),
   24 : (24px, 1.5),
) !default;



$headersFluids: (/*name :  fontsize, lineheight */
   12 : (1px, 2px, .3),
   14 : (14px, 12px,.9),
   16 : (16px, 12px,.9),
   18 : (18px, 12px,.9),
   20 : (20px, 12px,.9),
