/*+------------------------------------------------------------+
 |       -BOTONES    
 +------------------------------------------------------------+*/
/*
 * Definimos los botones y sus variantes
 */
/**
 * .btn es la clase principal para definir un botón  es el tipo
 */
.btn {
    position: relative;
    display: inline-block;
    line-height: 1;
    text-align: center;
    vertical-align: middle;
    box-sizing: border-box;
    font-size: 14px;
    vertical-align: middle;
    border: none;
    white-space: nowrap;
    cursor: pointer;
    padding: 16px 8px;
    @include font-medium();
    /**
 	* Nadie quiere un botón con texto subrayado cuando hacemos hover.
 	*/
    &:hover {
        text-decoration: none;
        opacity: 0.6;
    }
    &:active,
    &:focus {
        outline: none;
    }
    &:visited {
        outline: none;
    }

    &:disabled,
    &.disabled {
        opacity: 0.2;
    }
}

/*+------------------------------------------------------------+
 |       -TAMAÑOS    
 +------------------------------------------------------------+*/
$btn-text-mini: 12px;
$btn-text-small: 14px;
$btn-text-medium: 14px;
$btn-text-large: 14px;
$btn-text-xlarge: 16px;
$btn-text-full: 14px;
.btn--mini {
    padding-top: $padding-global * 1 + 2px;
    padding-bottom: $padding-global * 1;
    padding-right: $padding-global * 3;
    padding-left: $padding-global * 3;
    font-size: $btn-text-mini;
}
.btn--small {
    padding-right: $padding-global * 2;
    padding-left: $padding-global * 2;
    font-size: $btn-text-small;
}
.btn--medium {
    padding-right: $padding-global * 5;
    padding-left: $padding-global * 5;
    font-size: $btn-text-medium;
    max-width: 272px;
    width: 100%;
}

.btn--large {
    min-width: 200px;
    max-width: 400px;
    width: 100%;
    padding-right: $padding-global * 7;
    padding-left: $padding-global * 7;
    font-size: $btn-text-large;
}
.btn--xlarge {
    padding-right: $padding-global * 8;
    padding-left: $padding-global * 8;
    font-size: $btn-text-xlarge;
    position: relative;
    display: inline-block;
    min-height: 48px;
    min-width: 200px;
    max-width: 400px;
    padding: 16px;
    font-size: 16px;
    line-height: 24px;
    text-align: center;
    text-decoration: none;
    cursor: pointer;
}
.btn--full {
    width: 100%;
    padding-right: $padding-global * 2;
    padding-left: $padding-global * 2;
    font-size: $btn-text-full;
    height: 48px;
}

.btn--round {
	border-radius: 50px;
}

/*+------------------------------------------------------------+
 |       -TIPOS DE BOTONES    
 +------------------------------------------------------------+*/
.btn-xs {
    position: relative;
    display: inline-block;
    line-height: 1.2;
    text-align: center;
    vertical-align: middle;
    box-sizing: border-box;
    font-size: 12px;
    margin-right: $padding-global;
    white-space: nowrap;
    cursor: pointer;
    padding: $padding-btn / 2;

    &:hover {
        text-decoration: none;
        opacity: 0.6;
    }
    &:active,
    &:focus {
        outline: none;
    }
    &:visited {
        outline: none;
    }
}
.btn-underline {
    display: inline;
    position: relative;
    text-align: center;
    outline: none;
    padding: 4px 0;
    text-align: center;
    cursor: pointer;
    line-height: 1;
    background: transparent;
    border: none;
    color: $primary;
    &:after {
        content: "";
        background-color: $primary;
        width: 100%;
        position: absolute;
        bottom: 0px;
        left: 0px;
        height: 1px;
    }
    &:hover,
    &:focus,
    &.focus {
        opacity: 0.6;
        background-color: transparent;
        color: $primary;
        text-decoration: none;
        cursor: pointer;
        &:after {
            opacity: 0;
        }
    }
    &:active,
    &.active {
        &:focus,
        &.focus {
            outline: 0;
        }
        outline: 0;
        background-image: none;
        box-shadow: none;
        opacity: 0.6;
    }
    &:disabled,
    &.disabled {
        opacity: 0.2;
    }
    .has-light & {
        color: white;
        &:after {
            background-color: white;
        }
        &:hover,
        &:focus,
        &.focus {
            background-color: transparent;
            color: white;
        }
    }
}
.btn-block {
    display: block;
    width: 100%;
}
.btn-blue {
    background-color: #3b5998;
    color: #fff;
    border: 1px solid #3b5998;
}
/*+------------------------------------------------------------+
