/*+------------------------------------------------------------+
 |       -GRUPOS DE BOTONES    
 +------------------------------------------------------------+*/
/**
 * Con esta clase podemos agrupar los botones
 * en grupos horizontales.
 *
 */

.btns{
    align-items: center;
    display: flex;
    flex-wrap: wrap;
    justify-content: flex-start;
    .btn{
        margin-right:  $padding-global;
    }

}

 .btns .btn:not(:last-child) {
    margin-right:  $padding-global;
}


.btn-group {
    position: relative;
    display: flex;
    & > :not(:first-child):not(:last-child) {
        border-radius: 0;
        margin-left: -1px;
    }
    [class^="btn--"],
