 +------------------------------------------------------------+*/

.has-light {
    .btn-primary {
        color: $primary;
        background-color: #fff;
        border: 1px solid #fff;
    }
    .btn-phantom {
        color: #fff;
        background-color: transparent;
        border: 1px solid #fff;
    }
    .btn{
            color: white;
            border-color: white;
            &:after {
                background-color: white;
            }
    }
}

