input:focus {
    outline: none;
    border: 1px solid black;
}
.form {
    width: 100%;
}
.form-control[disabled],
.form-control[readonly],
fieldset[disabled] .form-control {
    background-color: transparent;
    opacity: 1;
}
select {
    background-color: #fff;
    border-color: #dbdbdb;
    border-radius: 0;
    color: #363636;
}
label {
    font-size: 14px;
}
.input,
.select select {
    -webkit-appearance: none;
    align-items: center;
