        line-height: 1;
        width: 150px;
        text-align: center;
        @include font-medium();
    }
    .guide-title {
        padding-left: 200px;
    }
    &:last-child {
        border-bottom: 1px solid #eaeaea;
    }
}
input::-webkit-input-placeholder {
    color: #aaa;
    transform: translate3d(0, 0, 0);
}
.form-input-label {
    font-family: $font-family-form;
    position: relative;
    margin-bottom: 24px;
    & > input,
    & > label {
        font-family: $font-family-form;
        padding: 16px;
        font-weight: normal;
    }
    & > label {
        box-sizing: border-box;
        position: absolute;
        top: 0px;
        left: 0;
        display: block;
        width: 100%;
        font-weight: normal;
        margin-top: 1px;
        margin-bottom: 0;
        line-height: 1.1;
        color: #757575;
        border-radius: 0.25rem;
        transition: all 0.1s ease-in-out;
        pointer-events: none;
    }
    & input::-webkit-input-placeholder {
        color: transparent;
    }
    & input:-ms-input-placeholder {
        color: transparent;
    }
    & input::-moz-placeholder {
        color: transparent;
    }
    & input::placeholder {
        color: transparent;
    }
    & input:not(:placeholder-shown) {
        padding-top: calc(#{$input-padding-y} + #{$input-padding-y} * (2 / 3));
        padding-bottom: calc(#{$input-padding-y} / 3 + 3px);
    }
    & input:not(:placeholder-shown) ~ label {
        padding-top: calc(#{$input-padding-y} / 3 + 1px);
        padding-bottom: calc(#{$input-padding-y} / 3);
        font-size: 12px;
        color: #777;
    }
    & input::-webkit-list-button,
    & input::-webkit-calendar-picker-indicator{
        display: none;
        opacity: 0;
    }

    input:-webkit-autofill,
    input:-webkit-autofill:hover, 
    input:-webkit-autofill:focus,
    textarea:-webkit-autofill,
    textarea:-webkit-autofill:hover,
    textarea:-webkit-autofill:focus,
    select:-webkit-autofill,
    select:-webkit-autofill:hover,
    select:-webkit-autofill:focus {
      border: 1px solid #eaeaea;
      -webkit-text-fill-color: black;
      -webkit-box-shadow: 0 0 0px 1000px #fff inset;
      transition: background-color 5000s ease-in-out 0s;
    }

}
/*+------------------------------------------------------------+
   |       -FALLBACK PARA EDGE    
   +------------------------------------------------------------+*/
@supports (-ms-ime-align: auto) {
    .form-input-label > label {
        display: none;
    }
    .form-input-label input:-ms-input-placeholder {
        color: #777;
    }
}
@media all and (-ms-high-contrast: none), (-ms-high-contrast: active) {
    .form-input-label > label {
        display: none;
    }
    .form-input-label input:-ms-input-placeholder {
        color: #777 !important;
    }
}
/*+------------------------------------------------------------+
 |       -SELECT  
 +------------------------------------------------------------+*/
.select {
    display: inline-block;
    max-width: 100%;
    position: relative;
    vertical-align: top;
    -webkit-appearance: none;
    align-items: center;
    border-radius: 0;
    box-shadow: none;
    display: inline-flex;
    justify-content: flex-start;
    position: relative;
    vertical-align: top;
    select {
        cursor: pointer;
        display: block;
        max-width: 100%;
        outline: 0;
    }
    label {
        position: absolute;
        top: 19px;
        left: 16px;
        z-index: 1;
    }
    &::after {
        border: 1px solid $primary;
        border-radius: 0px;
        border-right: 0;
        border-top: 0;
        content: " ";
        display: block;
        height: 8px;
        margin-top: -6px;
        pointer-events: none;
        position: absolute;
        top: 50%;
        right: 20px;
        transform: rotate(-45deg);
        transform-origin: center;
        width: 8px;
    }
    &:not(.is-multiple) {
        height: 56px;
    }
    &:not(.is-multiple):not(.is-loading)::after {
        border-color: $primary;
    }
    select::-ms-expand {
        display: none;
    }
    select[disabled]:hover,
    fieldset[disabled] select:hover {
        border-color: #f5f5f5;
    }
    select:not([multiple]) {
        padding-right: 45px;
    }
    select[multiple] {
        height: auto;
        padding: 0;
    }
    select[multiple] option {
        padding: 0 40px;
    }
    &:not(.is-multiple):not(.is-loading):hover::after {
        border-color: #363636;
    }
    &.select-label {
        select {
            padding-left: 100px;
        }
    }
    &.select-box{
		height: auto;
		select{
			background-color: #eaeaea;
			min-width: 24px;
			width: 100%;
			height: 24px;
			padding: 0px 16px 0px 8px;
			font-size: 14px;
			border-radius: 2px;
			border: none;
			text-align: center;
		}
        &::after{
			display: block;
			right: 6px;
			width: 5px;
			height: 5px;
			margin-top: -3px;
		}
	}
    &.select-flat {
        width: 100%;
        label {
            z-index: 0;
            left: 0;
        }

        select {
            border: none;
            padding-left: 0px;
            background: none;
            padding-right: 40px;
        }
    }
}
.hg-form {
    .row {
        padding-right: 0;
        [class*="col-"] {
            padding-right: 0;
            &:first-child {
                padding-right: 0;
            }
            &:last-child {
                padding-right: $padding-global;
            }
        }
    }
}
$checkbox-svg-pd: 20px;
$checkbox-svg-brad: 20px;
.checkbox-svg {
    svg {
        margin: 0 auto;
        width: 50px;
    }
}
//display flex
.checkbox-svg-label {
    background: #ffffff;
    border: 1px solid #4bcac5;
    border-radius: $checkbox-svg-brad;
    filter: grayscale(100%);
    display: flex;
    width: 100%;
    padding: $checkbox-svg-pd;
    box-sizing: border-box;
    transition: all 0.2s ease;
    opacity: 0.5;
    min-height: 200px;
}
.checkbox-svg [type="radio"] {
    position: absolute;
    left: -9999px;
}
.checkbox-svg-ico {
    position: absolute;
    box-sizing: border-box;
    width: 24px;
    height: 24px;
    top: $checkbox-svg-pd;
    right: $checkbox-svg-pd;
    left: auto;
    border: 1px solid #4bcac5;
    background-color: #4bcac5;
    outline: 0;
    vertical-align: top;
    margin: 0;
    border-radius: 50%;
    opacity: 1;
}
.ico-radio {
    position: absolute;
    top: 7px;
    left: 7px;
    width: 8px;
    height: 8px;
    background-color: white;
    border-radius: 50%;
    -webkit-transition: all 0.2s;
    transition: all 0.2s;
}
.checkbox-svg [type="radio"]:checked,
.checkbox-svg :hover {
    & + .checkbox-svg-label {
        opacity: 1;
        cursor: pointer;
        filter: grayscale(0);
        box-shadow: 6px 6px 17px 0 rgba(74, 111, 110, 0.27);
    }
    & + label .ico-radio {
        opacity: 1;
        transform: scale(1);
    }
    label .checkbox-svg-ico {
        opacity: 1;
    }
    & + label .ico-radio {
        opacity: 1;
        transform: scale(1);
    }
}
.checkbox-svg [type="radio"]:not(:checked) + label .ico-radio {
    opacity: 0;
    transform: scale(0);
}

$padding-btn: 14px;
$svg-size: 16px;
.form-icon {
    position: absolute;
    top: 0;
    left: 0;
    padding: $padding-btn;
    svg {
        width: $svg-size;
        height: $svg-size;
    }
}

.btn.btn-link.has-ico-pre {
    padding-left: 18px;
    .ico-pre {
        margin: 0;
        top: -1px;
    }
}
.has-ico-pre {
    &.btn,
    & > input,
    & > label {
        padding-left: $padding-btn * 2 + $svg-size + 4px;
    }
    .form-icon {
        top: 0;
        left: 0;
    }
}
.has-ico-post {
    &.btn,
    & > input,
    & > label {
        padding-right: $padding-btn * 2 + $svg-size;
    }
    .form-icon {
        padding: $padding-btn;
        top: 0;
        right: 0;
        left: auto;
    }
}
.input-subtext {
    position: absolute;
    width: 100%;
    margin-top: 5px;
    line-height: 1.2;
}
.form-input-label.input-line .input {
    border: none;
}
.input-line > input,
.input-line > label {
    padding: 12px 0 8px 0;
}
.input-line > input {
    height: 40px;
}
.form-input-prefix {
    display: flex;
    .input-prefix {
        width: 52px;
        display: inline-block;
        margin-right: 8px;
    }
    .input-prefix .input {
        padding-left: 0;
        padding-right: 0;
        text-align: center;
    }
    .form-input-label {
        display: inline-block;
        width: calc(100% - 60px);
    }
}


.select-line {
	width: 100%;
	.input,
	select,
	.textarea {
		background-color: #fff;
		border-color: $primary;
		color: #363636;
		max-width: 100%;
		width: 100%;
		font-size: 14px;
		line-height: 1;
		border-top: none;
		border-right: none;
		border-left: none;
		padding-left: 0;
		padding-right: 0;
	}
	&.select:after {
		width: 10px;
		height: 10px;
		right: 4px;
	}
}


.input-line-v2 {
	position: relative;
	display: flex;
	padding-right: 64px;
	.input,
	.input:focus {
		@include font-bold();
		padding-left: 0;
		padding-bottom: 4px;
		padding-right: 0;
		padding-top: 12px;
		height: auto;
		border: none;
		border-bottom: 1px solid black;
	}
	.input::-webkit-input-placeholder {
		@include font-regular();
		text-overflow: inherit;
		line-height: initial;
		white-space: pre;
		overflow-wrap: normal;
		-webkit-user-modify: read-only !important;
		overflow: hidden;
	}
}

/*+------------------------------------------------------------+
 |       -Soporte para lenguajes árabes  
 +------------------------------------------------------------+*/

 .is-rtl{
	.select{
		&.select-box{
			select{
				padding: 0px 8px 0px 16px;
			}
			&::after{
				left: 6px;
				right: auto;
			}
		}
        &.select-flat {
            label {
                left: auto;
            }
            select {
                padding-right: 0;
            }

            &::after {
                left: 20px;
                right: auto;
            }
        }
	}

    .form-input-label {
        &.icon-right {
            .form-text {
                right: auto;
                left: 0;
            }
        }
        &.has-ico-post {
            svg-icon {
                position: absolute;
                right: 0px;
            }
        }
    }
}

