/*+------------------------------------------------------------+
 |       -LINKS    
 +------------------------------------------------------------+*/

$opacity-links:.6;


a {
    &:hover {
        opacity: $opacity-links;
    }
}

.ico-links {
    margin-left: 24px;
    svg {
      position: absolute;
      left: -24px;
      bottom: 2px;
    }
  }


.link1 {
    display: inline;
    position: relative;
    text-align: center;
    outline: none;
    padding: 4px 0;
    text-align: center;
    cursor: pointer;
    background: transparent!important;
    border: none;
    &:after {
        content: '';
        background-color: $primary;
        width: 100%;
        position: absolute;
        bottom: 0px;
        left: 0px;
        height: 1px;
    }
    &:hover{
        opacity: $opacity-links;
    }
}
.link2 {
    text-decoration: none;
    position: relative;
    @include font-medium();
    &:hover {
        opacity: $opacity-links;
        &::after {
            -webkit-transform: scaleX(1);
            -ms-transform: scaleX(1);
            transform: scaleX(1)
        }
    }
}
.link3,
.link3::before {
    @include font-medium();
    text-align: center;
    display: inline-block;
    position: relative;
    top: 0;
    left: 0;
    transition: all .2s linear;
    white-space: nowrap;
    &:hover{
        opacity: $opacity-links;
    }
}
.link3::before {
    position: absolute;
    padding: 0;
    content: attr(data-text);
    opacity: 0;
    @include font-medium();
}
.link3:hover,
.link3.hover {
    opacity: $opacity-links;
}
.link3:hover::before {
    opacity: 1;
}


.link4 {
    position: relative;
    display: inline-block;
    border: 0;
    transform: none;
    transition: background-color 0.3s ease-in-out;
    margin: 0px;
    padding: 2px 0;
    cursor: pointer;
    &:hover {
        opacity: $opacity-links;
    }
    &:after {
        content: '';
        background-color: $primary;
        width: 100%;
        position: absolute;
        bottom: 0px;
        left: 0px;
        height: 1px;
    }
}

.link5,u {
    transition: color 250ms linear;
    text-decoration: none;
    position: relative;
    &:hover {

            opacity: $opacity-links;

        &::after {
            -webkit-transform: scaleX(1);
            -ms-transform: scaleX(1);
            transform: scaleX(1)
        }
    }
    &:focus {
        outline: none;
        text-decoration: none;
    }
    &:focus:hover {}
    &:-moz-focusring {
        outline: none !important;
        background: none;
    }
    &::after {
        content: "";
        position: absolute;
        width: 100%;
        height: 2px;
        bottom: -4px;
        left: 0;
        background: $primary;
        transform: scaleX(0);
        transition: transform $transition;
        transition: transform $transition, -webkit-transform $transition;
    }
}

.link5-2{
  @include font-bold();
  transition: color 250ms linear;
  text-decoration: none;
  position: relative;
  &:focus {
    outline: none;
    text-decoration: none;
  }
  &:-moz-focusring {
    outline: none !important;
    background: none;
  }
  &::after {
    content: "";
    position: absolute;
    width: 0%;
    height: 1px;
    bottom: -4px;
    left: 0;
    background: $primary;
    transition: 0.6s;
  }
  &::before {
    content: "";
    position: absolute;
    width: 100%;
    height: 1px;
    bottom: -4px;
    left: 0;
    background: $primary;
    opacity: 0.3;
  }
  &:hover {
    opacity: 1;
    &::after {
      width: 100%;
      transition: 0.6s;
    }
  }
}

.link6 {
    @include font-bold;
    position: relative;
    display: inline-block;
    padding: 4px 0;
    margin: 20px 0;
    border-bottom: 2px solid $primary;
    color: black;
    text-align: left;
    text-decoration: none;
    cursor: pointer;
    text-transform: uppercase;
    &:hover{
        opacity: $opacity-links;
    }
}

.link7 {
    position: relative;
    text-decoration: none;
    &:after {
        content: '';
        position: absolute;
        bottom: 0;
        left: 0;
        z-index: 3;
        width: 0;
        height: 1px;
        background: $primary;
        -webkit-animation: underline 1s 0.5s cubic-bezier(0.55, 0.085, 0, 0.99) forwards;
        animation: underline 1s 0.5s cubic-bezier(0.55, 0.085, 0, 0.99) forwards;
    }
    &:hover{
        opacity: $opacity-links;
    }
}

.link8{
    @include font-medium;
        font-weight: inherit;
        position: relative;
        display: inline-block;
        border: 0;
        transform: none;
        transition: background-color .3s ease-in-out;
        margin: 0;
        font-size: 14px;
        line-height: 1.2;
        padding: 2px 0;
        text-decoration: underline;
        &:hover{
            opacity: $opacity-links;
        }
    }

.link9 {
	font-weight: 600;
	position: relative;
	display: inline-block;
	border: 0;
	transform: none;
	margin: 0px;
	font-size: 14px;
	line-height: 14px;
	padding:  0;
    &:hover{
        opacity: $opacity-links;
    }
}

.link-button-prev {
    background: transparent !important;
    position: relative;
    width: 40px;
    height: 40px;
    z-index: 1;
    cursor: pointer;
    border-radius: 50%;
