.inner-button {
    margin-top: -1px;
    display: block;
    width: 40px;
    height: 40px;
    color: white;
    &::after {
        border: 1px solid $primary;
        border-radius: 0px;
        border-right: 0;
        border-top: 0;
        content: " ";
        display: block;
        height: 10px;
        margin-top: -8px;
        pointer-events: none;
        position: absolute;
        top: 53%;
        right: 16px;
        transform: rotate(-135deg);
        transform-origin: center;
        width: 10px;
    }
}

.has-light {
    .link1 {
        color: white;
        &:after {
            background-color: white;
        }
    }
    .link4 {
        color: white;
        &:after {
            background-color: white;
        }
        .link4-underline {
            background: #fff;
        }
    }
    .link5 {
        color: #ffffff;
        &:after {
            background: #ffffff;
        }
    }
    .link6 {
        color: #ffffff;
        border-bottom: 2px solid #ffffff;
    }
    .link7 {
        color: #ffffff;
        &:after {
            background: #ffffff;
        }
    }
    .link8{
        color: #ffffff;
        }
