/*+------------------------------------------------------------+
 |       -TABS  
 +------------------------------------------------------------+*/
/*
 * Definimos los botones y sus variantes
 <div class="tabs">
  <ul>
    <li class="is-active"><a>Pictures</a></li>
    <li><a>Music</a></li>
    <li><a>Videos</a></li>
    <li><a>Documents</a></li>
  </ul>
</div>
 */
.tabs {
    .list-equal {
        display: flex;
        li {
            flex-grow: 1;
        }
    }
    ul {
        align-items: center;
        border-bottom-color: #dbdbdb;
        border-bottom-style: solid;
        border-bottom-width: 1px;
        display: flex;
        flex-grow: 1;
        flex-shrink: 0;
        justify-content: flex-start;
        margin: 0;
        font-size: 14px;
        @include font-bold();
    }
    li {
        display: block;
        margin: 0;
        &.is-active a {
            border-bottom-color: $primary;
            border-bottom-width: 2px;
            padding-bottom: $padding-global * 2 - 0;
            color: $primary;
        }
        &.is-active span {
            border-bottom-color: $primary;
            border-bottom-width: 2px;
            padding-bottom: $padding-global * 2 - 0;
            color: $primary;
        }
        &:after {
            display: none;
        }
    }
    a {
        align-items: center;
        border-bottom-color: #dbdbdb;
        border-bottom-style: solid;
        border-bottom-width: 1px;
        color: $primary;
        display: flex;
        justify-content: center;
        margin-bottom: -1px;
        padding: $padding-global * 2;
        vertical-align: top;
        padding-bottom: $padding-global * 2 + 1;
        &:hover {
            border-bottom-color: $primary;
            border-bottom-width: 2px;
            padding-bottom: $padding-global * 2 - 0;
            color: $primary;
            cursor: pointer;
        }
    }
    span {
        align-items: center;
        border-bottom-color: #dbdbdb;
        border-bottom-style: solid;
        border-bottom-width: 1px;
        color: $primary;
        display: flex;
        justify-content: center;
        margin-bottom: -1px;
        padding: $padding-global * 2;
        vertical-align: top;
        padding-bottom: $padding-global * 2 + 1;
        &:hover {
            border-bottom-color: $primary;
            border-bottom-width: 2px;
            padding-bottom: $padding-global * 2 - 0;
            color: $primary;
            cursor: pointer;
        }
    }
    &.is-center ul {
        justify-content: center;
    }
}
.tabs-list {
    margin-left: -8px;
    li {
        margin: 0;
        padding-left: 8px;
        padding-right: 8px;
        span {
            position: relative;
            &:hover {
                cursor: pointer;
                &:after {
                    content: "";
                    width: 100%;
                    background: black;
                    height: 2px;
                    position: absolute;
                    bottom: -4px;
                    left: 0;
                }
            }
        }
        &.is-active span {
            &:after {
                content: "";
                width: 100%;
                background: black;
                height: 2px;
                position: absolute;
                bottom: -4px;
                left: 0;
            }
        }
    }
}
.tabs-gray {
    width: 100%;
    border: none;
    position: relative;
    width: 100%;
    background-color: #f5f5f5;
    ul {
        border: none;
    }
    li {
        display: block;
        margin: 0;
        width: 100%;
    }
    a,
    span {
        @include font-medium;
        color: #757575;
        border-color: #f5f5f5;
        position: relative;
        &:hover {
