}
.feel-close {
	position: absolute;
	top: 20px;
	right: 20px;
	width: 24px;
	height: 24px;
    transition: all ease .2s;
	transform: rotate(-45deg);
	svg {
		padding: 4px;
		width: 100%;
		height: 100%;
	}
}
.feel-minibox {
	padding:  24px;
    transition: all ease .2s;
   &:hover {
       background-color: #fafafa;
       cursor: pointer;
    .feel-close{
		transform: rotate(136deg);
    }
   }
   @media (min-width: $break-md) {
	padding: 48px ;
    }
}
.is-opened{
    .feel-close{
        transform: rotate(0);
    }
}
.feel-bar {
	border-top: 1px solid $border-gray;
	border-bottom: 1px solid $border-gray;
	a {
		padding: 8px;
		display: inline-block;
	}
}
.list-active {
	position: relative;
	&:after {
		position: absolute;
		content: "";
		width: 100%;
		height: 4px;
		background-color: $primary;
		bottom: 0;
		left: 0;
	}
}
.feel-group {
	display: flex;
	> :nth-child(2) {
		order: 2;
	}
	> :nth-child(3) {
		order: 3;
	}
	> :nth-child(4) {
		order: 4;
	}
	> :nth-child(5) {
		order: 5;
	}
	> :nth-child(6) {
		order: 6;
	}
	@media (min-width: 992px) {
		> :nth-child(2) {
			order: 4;
		}
		> :nth-child(3) {
			order: 3;
		}
		> :nth-child(4) {
			order: 5;
		}
		> :nth-child(5) {
			order: 3;
		}
		> :nth-child(6) {
			order: 6;
		}
	}
}

